function Calc_Date_diff(strValue) 
 {

   var strDate1 = strValue[0];
   var strDate2 = strValue[1]; 

   if(strDate2.indexOf(' 12:') !== -1)
   {
    	if(strDate2.indexOf(' PM') !== -1)
        {
            strDate2=strDate2.replace(' PM','');
        }
   }

   if (strDate1== "")
   {
    	var dt1 = new Date();
   }
   else
   {
   		var dt1 = new Date(strDate1);
   }

   var dt2 = new Date(strDate2);  

   if (strDate1 == 'Collection')
   {
     dt2.setHours( dt2.getHours() - 4 );
   }

   var D_diff = (Date.UTC(dt1.getFullYear(), dt1.getMonth(), dt1.getDate()) - Date.UTC(dt2.getFullYear(), dt2.getMonth(), dt2.getDate()) ) /(1000 * 60 * 60 * 24);    

    var M_diff = dt2.getMinutes();
    var H_diff = dt2.getHours();
    H_diff = H_diff+1;
    M_diff = Math.round((M_diff/5)+1);
    if (M_diff > 12)
    {
      H_diff = H_diff+1;
      M_diff = 1;
    }
   	if (H_diff > 24)
    {
      H_diff = 1;
      D_diff=D_diff-1
    }


    dt1.setDate( dt1.getDate() - D_diff );

    var v_date=dt1.getDate();
    if (v_date<10)v_date="0"+v_date;

    var v_month=dt1.getMonth()+1;
    if (v_month<10)v_month="0"+v_month;

    var v_year=dt1.getFullYear();

    var v_hour=H_diff-1;
    if (v_hour<10)v_hour="0"+v_hour;

    var v_minute=(M_diff-1)*5;
    if (v_minute<10)v_minute="0"+v_minute;

  return D_diff+"_"+H_diff+"_"+M_diff+"_"+v_date+"-"+v_month+"-"+v_year+" "+v_hour+":"+v_minute;

 }
